import React from 'react';
import Sidebar from './Sidebar';

function Dashboard(){
    return(
        <div className='container-fluid main_container'>
            <div className='row'>
                <aside className='col-md-2 text-light'> <Sidebar /> </aside>
                <section className='col-md-7 mt-3'>
                    Dashboard
                </section>
           </div>
        </div>
    )
}

export default Dashboard;
